INSERT INTO catalog_book VALUES(1,'The Sea-Wolf','The Sea-Wolf is a 1904 psychological adventure novel by American writer Jack London. The book''s protagonist, Humphrey van Weyden, is a literary critic who is a survivor of an ocean collision and who comes under the dominance of Wolf Larsen, the powerful and amoral sea captain who rescues him. Its first printing of forty thousand copies was immediately sold out before publication on the strength of London''s previous The Call of the Wild. Ambrose Bierce wrote, "The great thing—and it is among the greatest of things—is that tremendous creation, Wolf Larsen... the hewing out and setting up of such a figure is enough for a man to do in one lifetime... The love element, with its absurd suppressions, and impossible proprieties, is awful."','176813612','English',1);
INSERT INTO catalog_book VALUES(2,'The Call of the Wild','The Call of the Wild is a short adventure novel by Jack London, published in 1903 and set in Yukon, Canada, during the 1890s Klondike Gold Rush, when strong sled dogs were in high demand. The central character of the novel is a dog named Buck. The story opens at a ranch in Santa Clara Valley, California, when Buck is stolen from his home and sold into service as a sled dog in Alaska. He becomes progressively feral in the harsh environment, where he is forced to fight to survive and dominate other dogs. By the end, he sheds the veneer of civilization, and relies on primordial instinct and learned experience to emerge as a leader in the wild.','179138821','English',1);
INSERT INTO catalog_book VALUES(3,'Tom Sawyer','The fictional character''s name may have been derived from a jolly and flamboyant chief named Tom Sawyer with whom Twain was acquainted in San Francisco, California, while Twain was employed as a reporter at the San Francisco Call.[1][2] Twain used to listen to Sawyer tell stories of his youth, "Sam, he would listen to these pranks of mine with great interest and he''d occasionally take ''em down in his notebook. One day he says to me: ‘I am going to put you between the covers of a book some of these days, Tom.’ ‘Go ahead, Sam,’ I said, ‘but don’t disgrace my name.’"[2] Twain himself said the character sprang from three people, later identified as: John B. Briggs (who died in 1907), William Bowen (who died in 1893) and Twain;[2] however Twain later changed his story saying Sawyer was fully formed solely from his imagination, but as Robert Graysmith says, "The great appropriator liked to pretend his characters sprang fully grown from his fertile mind."[2]','1212343432432','English',2);
INSERT INTO catalog_book VALUES(4,'Lincoln','A masterful work by Pulitzer Prize–winning author David Herbert Donald, Lincoln is a stunning portrait of Abraham Lincoln’s life and presidency.','3435464575656','English',3);
